import React from "react";

const Rank = () => {
  return (
    <div className="">
      <div
        className=""
        style={{
          fontSize: "32px",
          textShadow: "2px 2px 8px rgba(0, 0, 0, 0.4)",
        }}
      >
        {"VG, your present rank is...."}
      </div>
      <div
        className=""
        style={{
          fontSize: "48px",
          textShadow: "2px 2px 8px rgba(0, 0, 0, 0.4)",
        }}
      >
        {"#1"}
      </div>
    </div>
  );
};

export default Rank;
